import React, { Component } from 'react'

export class Card extends Component {
  render() {
    return (
      <main>
        {this.state.items.map(el => (
            <picture className='logo'>
                <img src="" alt="casino's logo" />
            </picture>
        ))}
      </main>
    )
  }
}

export default Card
